  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-template-rows: repeat(auto, 1fr);
  gap: 1px;
  overflow-y: scroll;
`;

const Album = styled.li`
  background-color: var(--cream);

  &:last-child {
    background-color: red;
